import React from "react";
import { useFormik } from "formik";

const SignupForm = () => {
  const formik = useFormik({
    //jsx의  input name property와 일치시켜야 함
    initialValues: {
      name: "",
      email: "",
      channel: "",
    },
  });

  console.log(formik);

  return (
    <div>
      <form>
        <label>name</label>
        <input
          type="text"
          id="name"
          name="name"
          onChange={formik.handlechange}
          value={formik.values.name}
        ></input>

        <label>E-mail</label>
        <input
          type="text"
          id="email"
          name="email"
          onChange={formik.handlechange}
          value={formik.values.email}
        ></input>

        <label>channel</label>
        <input
          type="text"
          id="channel"
          name="channel"
          onChange={formik.handlechange}
          value={formik.values.channel}
        ></input>

        <button>Submit</button>
      </form>
    </div>
  );
};

export default SignupForm;
